bool GBKChecker::is_name_valid( const char* pName )
{
    unsigned char* pTr = (unsigned char*)pName;

    std::stack<unsigned char> _stack;
    bool result = true;

    while (*pTr)
    {
        if (_stack.empty())
        {
            if (_is_gbk_character_left(*pTr))
            {
                _stack.push(*pTr);
            }
            else
            {
                if (!is_allow_ascii(*pTr))
                {
                    return false;
                }
            }
        }
        else
        {
            if (_is_gbk_character_left(_stack.top()) && _is_gbk_character_right(*pTr))
            {
                if (!is_allow_gbk(_stack.top(), *pTr))
                {
                    return false;
                }
                _stack.pop();
            } 
            else
            {
                return false;
            }
        }

        ++pTr;
    }

    if (!_stack.empty())
        result = false;

    return result;
}

