{
    return gbk_allow_table[b0][b1];
}

bool GBKChecker::is_allow_ascii( unsigned char b )
{
    return ascii_allow_table[b];
}

bool GBKChecker::_is_gbk_character_left( unsigned char b )
{
    if (b >= 0x81 && b <= 0xFE)       //
    {
        return true;
    }

    return false;
}

bool GBKChecker::_is_gbk_character_right( unsigned char b )
{
    if (b >=0x40 && b <= 0xFE)   //
    {
        if (b == 0x7F)
        {
            return false;
        }
        return true;
    }

    return false;
}
